import { Row, Col, Container } from 'react-bootstrap';

export default function Footer() {
    return (
        <Container fluid className="bg-dark text-light">
            <Row>
                <Col className="text-center py-3">
                    Ini footer (Adli Mustofa | 120140022)
                </Col>
            </Row>
        </Container>
    );
}
